import Button from "../elements/Button";

const Buttons = ({ whichStep, setWhichStep }) => {
  return (
    <>
      {whichStep > 1 ? (
        <Button
          {...{
            setWhichStep,
            buttonText: "Previous",
            whichStep: whichStep - 1,
          }}
        />
      ) : null}
      <Button
        {...{
          setWhichStep,
          buttonText: "Next",
          whichStep: whichStep + 1,
          addClass: "right",
        }}
        className="right"
      />
    </>
  );
};

export default Buttons;
